import styled from "styled-components";


export const StyledNav = styled.nav`
    background: black;
    color: blue;
    height: 80px;
    margin-top: -25px;
    display: flex;
    justify-content: center;
    align-items: center;
    font-size: 5rem;
    position: sticky;
    top:0
    z-index: 10;


    h2 {color: blue;}
`
export const StyledNavLogo = styled.nav`
    color red;
    font-size: 5rem;
    top:0;
    background: black;

`
